const Header = () => (
  <header>
    <h2>
      <span>Rutakeh</span>
      <span>龍武株式会社</span>
    </h2>
    <ul>
      <li>Home</li>
      <li>Services</li>
      <li>About</li>
      <li>Contact</li>
    </ul>
